import './Pricing.css'
import circle1 from './assets/shared/desktop/bg-pattern-circle.svg'

function Pricing() {
    return (
        <div className="row position-relative overflow-hidden .price">
            <img alt='circle' src={ circle1} className='position-absolute circlee' />
            <div className='col-md-12 .pricing'>
                <h1>Pricing</h1>
</div>
        </div>
    )
}
export default Pricing
